package tui

import (
	"bytes"
	"encoding/base64"
	"image/png"

	"github.com/gdamore/tcell/v2"
	"github.com/rivo/tview"
)

const (
	encodedLogo = ""
)

func getLogoPrimitive() *tview.Image {
	image := tview.NewImage()
	b, err := base64.StdEncoding.DecodeString(encodedLogo)
	if err != nil {
		panic(err)
	}
	photo, err := png.Decode(bytes.NewReader(b))
	if err != nil {
		panic(err)
	}
	image.SetImage(photo)
	image.SetBorder(true)
	image.SetBackgroundColor(tcell.ColorBlack)
	image.SetColors(tview.TrueColor)
	return image
}
